Calyx uses the ref keyword to describe cells that are passed by reference: component add_one() -> () { cells { ref mem = comb_mem_d1(32, 4, 3); // A memory passed by reference. ... } ...
} This component defines mem as a memory that is passed by reference to the component. Inside the component, we can use the cell as usual. Next, to pass the memory to the component, we use the invoke syntax: component add_one() -> () { ... }
component main() -> () { cells { A = comb_mem_d1(32, 4, 3); // A memory that will be passed by reference. one = add_one(); ... } wires { ... } control { invoke one[mem = A]()(); // pass A as the `mem` for this invocation. }
} The Calyx compiler will correctly lower the add_one component and the invoke call such that the memory is passed by reference. In fact, any cell can be passed by reference in a Calyx program. Read the next section if you're curious about how this process is implemented.

