In the C++ code above, we've constructed an "l-value reference" to the array, which essentially means we can both read and write from x in the function add_one. Now, let's allow similar functionality at the Calyx IR level. We define a new component named add_one which represents the function above. However, we also need to include the correct ports to both read and write to x: Read from x Write to x read_data done address ports write_data write_en address ports Since we're both reading and writing from x, we'll include the union of the columns above: component add_one(x_done: 1, x_read_data: 32) -> (x_write_data: 32, x_write_en: 1, x_addr0: 1) { One tricky thing to note is where the ports belong, i.e. should it be an input port or an output port of the component? The way to reason about this is to ask whether we want to receive signal from or send signal to the given wire. For example, with read_data, we will always be receiving signal from it, so it should be an input port. Conversely, address ports are used to mark where in memory we want to access, so those are used as output ports. We then simply use the given ports to both read and write to the memory passed by reference. Note that we've split up the read and write to memory x in separate groups, to ensure we can schedule them sequentially in the execution flow. We're also using the exposed ports of the memory through the component interface rather than, say, x.write_data. group read_from_x { x_addr0 = 1'd0; // Set address port to zero. tmp_reg.in = x_read_data; // Read the value at address zero. tmp_reg.write_en = 1'd1; read_from_x[done] = tmp_reg.done; } group write_to_x { x_addr0 = 1'd0; // Set address port to zero. add.left = one.out; add.right = tmp_reg.out; // Saved value from previous read. x_write_data = add.out; // Write value to address zero. x_write_en = 1'd1; // Set write enable signal to high. write_to_x[done] = x_done; // The group is done when the write is complete. } Bringing everything back together, the add_one component is written accordingly: component add_one(x_done: 1, x_read_data: 32) -> (x_write_data: 32, x_write_en: 1, x_addr0: 1) { cells { one = std_const(32, 1); add = std_add(32); tmp_reg = std_reg(32); } wires { group read_from_x { x_addr0 = 1'd0; // Set address port to zero. tmp_reg.in = x_read_data; // Read the value at address zero. tmp_reg.write_en = 1'd1; read_from_x[done] = tmp_reg.done; } group write_to_x { x_addr0 = 1'd0; // Set address port to zero. add.left = one.out; add.right = tmp_reg.out; // Saved value from previous read. x_write_data = add.out; // Write value to address zero. x_write_en = 1'd1; // Set write enable signal to high. write_to_x[done] = x_done; // The group is done when the write is complete. } } control { seq { read_from_x; write_to_x; } }
