The primitive construct allows specification of the signature of an external Verilog module that the Calyx program uses. It has the following syntax: [comb] primitive name<attributes>[PARAMETERS](ports) -> (ports); The syntax for primitives resembles that for components , with some additional pieces: The comb keyword signals that the primitive definition wraps purely combinational RTL code. This is useful for certain optimizations. Attributes specify useful metadata for optimization. PARAMETERS are named compile-time (metaprogramming) parameters to pass to the Verilog module definition. The primitive definition lists the names of integer-valued parameters; the corresponding Verilog module definition should have identical parameter declarations. Calyx code provides values for these parameters when instantiating a primitive as a cell . The ports section contain sized port definitions that can either be positive number or one of the parameter names. For example, the following is the signature of the std_reg primitive from the Calyx standard library: primitive std_reg<"state_share"=1>[WIDTH]( @write_together(1) @data in: WIDTH, @write_together(1) @interval(1) @go write_en: 1, @clk clk: 1, @reset reset: 1
) -> ( @stable out: WIDTH, @done done: 1
) The primitive defines one parameter called WIDTH, which describes the sizes for the in and the out ports.

