Assignments connect ports between two cells together, with this syntax: <cell>.<port> = [<guard> ?] <cell>.<port>; The left-hand and right-hand side are both port references , which name a specific input or output port within a cell declared within the same component. The optional guard condition is a logical expression that determines whether the connection is active. For example, this assignment: r.in = add.out; unconditionally transfers the value from a port named out in the add cell to r's in port. Assignments are simultaneous and non-blocking . When a block of assignments runs, they all first read their right-hand sides and then write into their left-hand sides; they are not processed in order. The result is that the order of assignments does not matter. For example, this block of assignments: r.in = add.out;
add.left = y.out;
add.right = z.out; is a valid way to take the values from registers y and z and put the sum into r. Any permutation of these assignments is equivalent.

