A group is a way to name a set of assignments that together represent some meaningful action: group name<attributes> { assignments... name[done] = done_cond;
} Assignments within a group can be reasoned about in isolation from assignments in other groups. Unlike continuous assignments , a group's encapsulated assignments only execute as dictated by the control program . This means that seemingly conflicting writes to the same ports are allowed: group foo { r.in = 32'd10; foo[done] = ...;
}
group bar { r.in = 32'd22; bar[done] = ...;
} However, group assignments must not conflict with continuous assignments defined in the component: group foo { r.in = 32'd10; ... // Malformed because it conflicts with the write below. foo[done] = ...
}
r.in = 32'd50; Groups can take any (nonzero) number of cycles to complete. To indicate to the outside world when their execution has completed, every group has a special done signal , which is a special port written as <group>[done]. The group should assign 1 to this port to indicate that its execution is complete. Groups can have an optional list of attributes . Well-formedness : All groups are required to run for at least one cycle. (Sub-cycle logic should use comb group instead.)

